from collections import Counter

def dna_counting(str):
    dna_counter = Counter(str)
    a_count = dna_counter['A']
    c_count =  dna_counter['C']
    g_count = dna_counter['G']
    t_count = dna_counter['T']


    return a_count, c_count, g_count, t_count


str = ""
a_count, c_count, g_count, t_count = dna_counting(str)
print(a_count)
print(c_count)
print(g_count)
print(t_count)